import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 16, height: 16, viewBox: "0 0 16 16", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M5.96 4.46a2.07 2.07 0 114.08 0l-.86 4.56a1.2 1.2 0 01-2.36 0l-.86-4.56z", fill: primaryFill }),
        React.createElement("path", { d: "M9.5 12.5a1.5 1.5 0 11-3 0 1.5 1.5 0 013 0z", fill: primaryFill }));
};
const Important16Filled = wrapIcon(rawSvg({}), 'Important16Filled');
export default Important16Filled;
